class WhackASnooScene extends Phaser.Scene {
  constructor(gameManager) {
    super({ key: 'WhackASnooScene' });
    this.gameManager = gameManager;
    console.log('gameManager is:', this.gameManager);
    console.log('gameManager.showNotification:', this.gameManager.showNotification);
    this.initializeUI();
  }

  initializeUI() {
    // Menu Screen Elements
    this.mainMenu = document.querySelector('.main-menu');
    this.gameScreen = document.querySelector('.game-screen');
    this.gameOverScreen = document.querySelector('.game-over-screen');
    this.achievementsScreen = document.querySelector('.achievements-screen');

    // Menu Buttons
    document.getElementById('start-game').addEventListener('click', () => this.startGame());
    document.getElementById('high-scores').addEventListener('click', () => this.showHighScores());
    document.getElementById('how-to-play').addEventListener('click', () => this.showHowToPlay());
    document.getElementById('achievement-button').addEventListener('click', () => this.gameManager.showAchievements());
    
    // Game Over Buttons
    document.getElementById('restart-game').addEventListener('click', () => this.restartGame());
    document.getElementById('back-to-menu').addEventListener('click', () => this.returnToMainMenu());
    document.getElementById('back-from-achievements').addEventListener('click', () => this.returnToMainMenu());
}
preload() {
  this.load.image('background-grass', 'data:image/png;base64,'); // Background

  this.load.image('hole', 'data:image/png;base64,');
  this.load.image('snoo', 'data:image/png;base64,');
}

startGame() {
  this.mainMenu.style.display = 'none';
  this.gameScreen.style.display = 'flex';
  this.gameOverScreen.style.display = 'none';
  
  // Reset game state
  this.restartGame();
}
showHighScores() {
  this.gameManager.showNotification('High Scores feature coming soon!');
}

showHowToPlay() {
  this.gameManager.showNotification('Whack the snoos as they appear! Try to get the highest score before time runs out!');
}
returnToMainMenu() {
  // Reset game state
  this.input.setDefaultCursor('default');
  this.gameManager.restartGame();
  
  // Show/hide appropriate screens
  this.mainMenu.style.display = 'flex';
  this.gameScreen.style.display = 'none';
  this.gameOverScreen.style.display = 'none';
  this.achievementsScreen.style.display = 'none';
}

create() {
  this.background = this.add.tileSprite(0, 0, this.scale.width, this.scale.height, 'background-grass').setOrigin(0); // Anchor to top-left
  
  this.holes = [];
  this.snoos = [];
  this.missTexts = [];

  // Create 9 holes and snoos
  for (let i = 0; i < 9; i++) {
    const x = 100 + (i % 3) * 200;
    const y = 100 + Math.floor(i / 3) * 200;

    // Create hole
    const hole = this.add.image(x, y, 'hole').setScale(0.3);
    this.holes.push(hole);

    // Create snoo
    const snoo = this.add.image(x, y, 'snoo').setScale(0.05).setVisible(false);
    snoo.setInteractive();

    // Create miss text
    const missText = this.add.text(x, y - 50, '❌', {
      fontSize: '40px',
      color: '#ff0000'
    }).setVisible(false).setOrigin(0.5);

    this.missTexts.push(missText);

    snoo.on('pointerdown', () => {
      if (snoo.visible && !this.gameManager.isGameOver) {
        // Hit snoo
        this.gameManager.incrementScore();
        
        // Create hit animation
        const hitText = this.add.text(x, y - 50, '✅', {
          fontSize: '40px',
          color: '#00ff00'
        }).setOrigin(0.5);
        
        // Fade out hit text
        this.tweens.add({
          targets: hitText,
          alpha: 0,
          y: y - 100,
          duration: 1000,
          onComplete: () => {
            hitText.destroy();
          }
        });

        snoo.setVisible(false);
      }
    });

    // Add pointerdown event for holes
    hole.setInteractive();
    hole.on('pointerdown', () => {
      // Check if snoo is visible in this hole
      const snoo = this.snoos[this.holes.indexOf(hole)];
      if (!snoo.visible && !this.gameManager.isGameOver) {
        // Increment misses
        this.gameManager.currentMisses++;
        
        // Update display
        document.getElementById('misses-counter').textContent = 
          `Misses: ${this.gameManager.currentMisses}/${this.gameManager.maxMisses}`;
        
        // Show miss text
        const missText = this.missTexts[this.holes.indexOf(hole)];
        missText.setVisible(true);
        
        // Check if max misses reached
        if (this.gameManager.currentMisses >= this.gameManager.maxMisses) {
          this.gameManager.gameOver();
          return;
        }
        
        // Hide miss text after a brief moment
        this.time.addEvent({
          delay: 500,
          callback: () => {
            missText.setVisible(false);
          },
          callbackScope: this
        });
      }
    });

    this.snoos.push(snoo);
  }

  // Track last visible snoo to handle misses
  this.lastVisiblesnoo = null;

  // Setup game timers
  this.time.addEvent({
    delay: 1000,
    callback: this.spawnsnoo,
    callbackScope: this,
    loop: true
  });

  this.time.addEvent({
    delay: 1000,
    callback: this.updateTimer,
    callbackScope: this,
    loop: true
  });

  // Add a timer to hide miss text
  this.time.addEvent({
    delay: 1500,
    callback: this.hideMissTexts,
    callbackScope: this,
    loop: true
  });
}

hideMissTexts() {
  this.missTexts.forEach(text => text.setVisible(false));
}

spawnsnoo() {
  if (this.gameManager.isGameOver) return;

  this.snoos.forEach(snoo => snoo.setVisible(false));

  const randomIndex = Phaser.Math.Between(0, this.snoos.length - 1);
  this.snoos[randomIndex].setVisible(true);
}

updateTimer() {
  if (this.gameManager.isGameOver) return;

  this.gameManager.timeLeft--;
  document.getElementById('timer').innerText = this.gameManager.timeLeft;

  if (this.gameManager.timeLeft <= 0) {
    this.gameManager.gameOver();
    this.scene.restart();
  }
}

restartGame() {
  // Reset Phaser scene
  this.scene.restart();
}
}

class WhackASnooGame {
  constructor() {
    // UI Element Selections
    this.output = document.querySelector('#messageOutput') || { textContent: '' };
    this.restartButton = document.querySelector('#restart-game');
    this.usernameLabel = document.querySelector('#username');
    this.scoreLabel = document.querySelector('#score');
    this.timerLabel = document.querySelector('#timer');
    this.challengeDesc = document.querySelector('#challenge-description');
    this.challengeProgress = document.querySelector('#challenge-progress');
    this.achievementsList = document.querySelector('#achievements-list');
    this.gameScreen = document.querySelector('.game-screen');
    this.gameOverScreen = document.querySelector('.game-over-screen');
    this.mainMenu = document.querySelector('.main-menu');
    this.achievementsScreen = document.querySelector('.achievements-screen');
    this.achievementButton = document.querySelector('#achievement-button');

    this.leaderboardScreen = document.querySelector('.leaderboard-screen');
    document.getElementById('view-leaderboard').addEventListener('click', () => this.showLeaderboard());
    document.getElementById('back-from-leaderboard').addEventListener('click', () => this.hideLeaderboard());

    // Game State
    this.username = 'Guest';
  if (this.usernameLabel) {
    this.usernameLabel.textContent = this.username;
  }
    this.score = 0;
    this.timeLeft = 60;
    this.isGameOver = false;
    this.comboCount = 0;
    this.maxMisses = 5;
    this.currentMisses = 0;
    this.missedsnoos = 0;
    
    // Session-only achievements
    this.achievements = [];

    // Daily Challenge Setup
    this.dailyChallenges = [
      {
        name: "snoo Mastery",
        description: "Hit 30 snoos without missing",
        goal: 30,
        reward: "🏆 snoo Hunter Badge"
      },
      {
        name: "Combo King",
        description: "Achieve a 5-hit combo",
        goal: 5,
        reward: "⚡ Lightning Reflexes Award"
      },
      {
        name: "Precision Player",
        description: "Hit 20 snoos with maximum 3 misses",
        goal: 20,
        maxMisses: 3,
        reward: "🎯 Sharpshooter Medal"
      }
    ];
    this.currentChallenge = this.getRandomChallenge();

    // Event Listeners
    if (this.restartButton) {
      this.restartButton.addEventListener('click', () => this.restartGame());
    }

    // Achievement Button Listener - Now ends the game
    if (this.achievementButton) {
      this.achievementButton.addEventListener('click', () => this.endGameAndShowAchievements());
    }

    // Notification System
    this.createNotificationContainer();

    // Phaser Game Configuration
    this.config = {
      type: Phaser.AUTO,
      width: '600',
      height: '400',
      parent: 'game-container',
      scale: {
        mode: Phaser.Scale.FIT,
        autoCenter: Phaser.Scale.CENTER_BOTH
      },
      scene: [new WhackASnooScene(this)]
    };

    this.game = new Phaser.Game(this.config);
    
    // Welcome message
    this.showWelcomeMessage();
  }
  showLeaderboard() {
    this.mainMenu.style.display = 'none';
    this.leaderboardScreen.style.display = 'flex';
    this.updateLeaderboardDisplay();
  }

  hideLeaderboard() {
    this.leaderboardScreen.style.display = 'none';
    this.mainMenu.style.display = 'flex';
  }

  updateLeaderboardDisplay() {
    const leaderboardList = document.getElementById('leaderboard-list');
    leaderboardList.innerHTML = '';

    this.leaderboard.forEach((entry, index) => {
      const entryElement = document.createElement('div');
      entryElement.className = 'leaderboard-entry';
      entryElement.innerHTML = `
        <span class="rank">#${index + 1}</span>
        <span class="username">${entry.username}</span>
        <span class="score">${entry.score}</span>
      `;
      leaderboardList.appendChild(entryElement);
    });
  }
  showWelcomeMessage() {
    const welcomeMessages = [
      "Welcome to Whack-A-Snoo! 🎮",
      "Ready to play? Let's go! 🚀",
      "Time to whack some snoos! 🔨",
      "Get ready for some fun! ⭐"
    ];
    
    const randomMessage = welcomeMessages[Math.floor(Math.random() * welcomeMessages.length)];
    this.showNotification(randomMessage, 5000);
  }

  endGameAndShowAchievements() {
    // Stop the game
    this.isGameOver = true;
    
    // Show achievements screen
    this.gameScreen.style.display = 'none';
    this.achievementsScreen.style.display = 'flex';
    
    // Update achievements list
    this.updateAchievementsList();
  }

  updateAchievementsList() {
    const achievementsList = document.getElementById('achievements-list');
    achievementsList.innerHTML = '';  // Clear previous list
  
    if (this.achievements.length === 0) {
      const noAchievementsElement = document.createElement('div');
      noAchievementsElement.textContent = 'No achievements unlocked yet!';
      noAchievementsElement.classList.add('no-achievements');
      achievementsList.appendChild(noAchievementsElement);
    } else {
      this.achievements.forEach(achievement => {
        const achievementElement = document.createElement('div');
        achievementElement.classList.add('achievement-item');
        achievementElement.innerHTML = `
          <span class="achievement-icon">🏅</span>
          <div class="achievement-details">
            <strong>${achievement.name}</strong>
            <p>${achievement.description}</p>
          </div>
        `;
        achievementsList.appendChild(achievementElement);
      });
    }
  }

  showNotification(message, duration = 3000) {
    // Update the content and show the notification
    this.notificationContainer.textContent = message;
    this.notificationContainer.classList.add('show');
    console.log('showing notification');
    // Hide after the duration
    setTimeout(() => {
      this.notificationContainer.classList.remove('show');
    }, duration);
  }
  updateUsername(newUsername) {
    this.username = newUsername;
    if (this.usernameLabel) {
      this.usernameLabel.textContent = newUsername;
    }
  }
  updateLeaderboardEntry(username, score) {
    if (!this.leaderboard) {
      this.leaderboard = [];
    }
    const existingEntry = this.leaderboard.find(entry => entry.username === username);
    if (!existingEntry || score > existingEntry.score) {
      if (existingEntry) {
        existingEntry.score = score;
      } else {
        this.leaderboard.push({ username, score });
      }
      this.leaderboard.sort((a, b) => b.score - a.score);
      this.updateLeaderboardDisplay();
    }
  }
  createNotificationContainer() {
    const existingContainer = document.querySelector('#notification-container');
    if (existingContainer) {
      this.notificationContainer = existingContainer;
    } else {
      this.notificationContainer = document.createElement('div');
      this.notificationContainer.id = 'notification-container';
      this.notificationContainer.style.cssText = `
        position: fixed;
        top: -100px;
        right: 20px;
        background-color: rgba(0, 0, 0, 0.9);
        color: white;
        padding: 10px 20px;
        border-radius: 5px;
        box-shadow: 0 4px 6px rgba(0, 0, 0, 0.3);
        z-index: 1000;
        opacity: 0;
        transform: translateY(0);
        transition: all 0.5s ease;
        pointer-events: none;
        font-size: 14px;
        line-height: 1.4;
        text-align: left;
      `;
      document.body.appendChild(this.notificationContainer);
    }
  }

  getRandomChallenge() {
    return this.dailyChallenges[Math.floor(Math.random() * this.dailyChallenges.length)];
  }

  incrementScore(missed = false) {
    if (missed) {
      this.comboCount = 0;
      this.missedsnoos++;
      this.currentMisses++;
      
      // Update misses display
      document.getElementById('misses-counter').textContent = `Misses: ${this.currentMisses}/${this.maxMisses}`;
      
      // Check if max misses reached
      if (this.currentMisses >= this.maxMisses) {
        this.gameOver();
        return;
      }
    } else {
      this.score++;
      this.comboCount++;
      this.showEncouragementMessage();
    }

    // Update score 
    this.scoreLabel.innerText = this.score;

    // Check challenge progress
    this.checkChallengeProgress();

    // Check for achievements
    this.checkAchievements();

    // Send score to parent window
    window.parent?.postMessage(
      {
        type: 'updateGameScore',
        data: { newScore: this.score, username: this.username }
      },
      '*'
    );
  }

  showEncouragementMessage() {
    const messages = [
      "You're doing amazing! 🌟",
      "Keep going, snoo hunter! 💪",
      "Spectacular whacking skills! 🏆",
      "You're unstoppable! 🚀",
      "snoo-tastic performance! 🎉"
    ];

    if (this.comboCount > 0 && this.comboCount % 5 === 0) {
      const specialMessage = `Wow! ${this.comboCount} hit combo! 🔥`;
      this.output.textContent = specialMessage;
    } else if (Math.random() < 0.3) {
      const message = messages[Math.floor(Math.random() * messages.length)];
      this.output.textContent = message;
    }
  }

  checkChallengeProgress() {
    const challenge = this.currentChallenge;
    let challengeCompleted = false;

    // Check challenge conditions based on challenge type
    switch (challenge.name) {
      case "snoo Mastery":
        challengeCompleted = this.score >= challenge.goal;
        break;
      case "Combo King":
        challengeCompleted = this.comboCount >= challenge.goal;
        break;
      case "Precision Player":
        challengeCompleted = this.score >= challenge.goal && this.missedsnoos <= challenge.maxMisses;
        break;
    }

    // Update challenge display
    this.challengeDesc.textContent = `${challenge.name}: ${challenge.description}`;
    this.challengeProgress.textContent = `Progress: ${this.score}/${challenge.goal}`;

    // Complete challenge if conditions met
    if (challengeCompleted) {
      this.completeDailyChallenge();
    }
  }

  completeDailyChallenge() {
    this.challengeProgress.innerHTML = `
        🎉 Challenge Completed! 
        <strong>${this.currentChallenge.reward}</strong>
    `;
    this.unlockAchievement(this.currentChallenge.name);

    // Reset or get new challenge
    this.currentChallenge = this.getRandomChallenge();
  }

  checkAchievements() {
    const achievements = [
      {
        name: "First snoo",
        condition: () => this.score === 1,
        description: "Whacked your first snoo! 🐭"
      },
      {
        name: "snoo Master",
        condition: () => this.score === 25,
        description: "Reached 25 snoos! Impressive! 🏆"
      },
      {
        name: "Combo Champion",
        condition: () => this.comboCount >= 10,
        description: "10-hit combo! Incredible reflexes! 🔥"
      }
    ];

    achievements.forEach(achievement => {
      if (achievement.condition() && !this.achievements.some(a => a.name === achievement.name)) {
        this.unlockAchievement(achievement.name, achievement.description);
      }
    });
  }

  unlockAchievement(name, description = '') {
    // Only add if not already present
    if (!this.achievements.some(a => a.name === name)) {
      const achievement = { name, description };
      this.achievements.push(achievement);

      // Show achievement as a notification while playing
      const achievementMessage = `🏅 Achievement Unlocked: ${name}\n${description}`;
      this.showNotification(achievementMessage);
    }
  }

  gameOver() {
    // End game logic
    this.isGameOver = true;
  
    this.gameScreen.style.display = 'none';
    this.gameOverScreen.style.display = 'flex';
    
    // Update final score
    document.getElementById('final-score').textContent = `Your Score: ${this.score}`;
    document.getElementById('final-misses').textContent = `Misses: ${this.currentMisses}/${this.maxMisses}`;
    // Trigger confetti
    this.triggerConfetti();

    // Send game over message to parent
    window.parent?.postMessage(
      {
        type: 'gameOver',
        data: { 
          finalScore: this.score, 
          username: this.username 
        }
      },
      '*'
    );
  }

  triggerConfetti() {
    // Added fallback in case global confetti function is not available
    if (typeof confetti === 'function') {
      const duration = 3 * 1000;
      const animationEnd = Date.now() + duration;
      const defaults = { startVelocity: 30, spread: 360, ticks: 60, zIndex: 0 };

      function randomInRange(min, max) {
          return Math.random() * (max - min) + min;
      }

      const interval = setInterval(function() {
          const timeLeft = animationEnd - Date.now();

          if (timeLeft <= 0) {
              return clearInterval(interval);
          }

          const particleCount = 50 * (timeLeft / duration);
          confetti(Object.assign({}, defaults, { 
              particleCount, 
              origin: { x: randomInRange(0.1, 0.3), y: Math.random() - 0.2 } 
          }));
          confetti(Object.assign({}, defaults, { 
              particleCount, 
              origin: { x: randomInRange(0.7, 0.9), y: Math.random() - 0.2 } 
          }));
      }, 250);
    }
  } 

  restartGame() {
    this.currentMisses = 0;

    this.score = 0;
    this.comboCount = 0;
    this.missedsnoos = 0;
    this.timeLeft = 60;
    this.isGameOver = false;
    this.achievements = []; // Clear session achievements
    document.getElementById('misses-counter').textContent = `Misses: 0/${this.maxMisses}`;

    // Reset DOM elements
    this.scoreLabel.innerText = '0';
    this.timerLabel.innerText = '60';
    this.challengeProgress.textContent = `0/${this.currentChallenge.goal}`;
    
    // Restart Phaser game
    if (this.game && this.game.scene.isActive('WhackASnooScene')) {
      this.game.scene.stop('WhackASnooScene');
    }
    this.game.scene.start('WhackASnooScene');

    // Show game screen
    this.gameScreen.style.display = 'flex';
    this.gameOverScreen.style.display = 'none';
    this.achievementsScreen.style.display = 'none';
  }
}
// Initialize game immediately
window.addEventListener('message', (event) => {
  //console.log('this is the event' + event);
  //console.log('event data type is: ' + event.data.type);
  if (event.data.type === 'devvit-message') {
    const { message } = event.data.data;
    if(!window.game) {
      window.game = new WhackASnooGame();
    }
    //console.log('Received from Devvit:', message);
    window.game.updateUsername(message.data.username);
    window.game.leaderboard = message.data.leaderboard || [];
    window.game.updateLeaderboardDisplay();
  }
});

